selector_to_html = {"a[href=\"#kumuleret-frekvens\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1.4. </span>Kumuleret frekvens<a class=\"headerlink\" href=\"#kumuleret-frekvens\" title=\"Permalink til denne overskrift\">#</a></h2><p>Den kumuleret frekvens kaldes ogs\u00e5 den summeret frekvens, og er blot frekvensen lagt sammen med summen af de foreg\u00e5ende frekvenser. Den kumuleret frekvens for en observation er derfor andelen af observationer i stikpr\u00f8ven, der er mindre end eller lig med observationen. Vi ben\u00e6vner den kumuleret frekvens med <span class=\"math notranslate nohighlight\">\\(F_i\\)</span> og definerer den som:</p>", "a[href=\"#equation-eq-kumulhyppighed\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kumulhyppighed\">\n\\[    H_i = H_{i-1} + h_i \\]</div>", "a[href=\"#karakterereksempel\"]": "<div class=\"proof eksempel admonition\" id=\"karakterereksempel\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 12.1 </span> (Karakterer)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>En klasse med 20 elever har f\u00e5et f\u00f8lgende karakterer i Matematik B:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    4, 4, 10, 02, 12, 12, 7, 7, 7, 12, 4, 10, 7, 7, 02, 7, 10, 10, 7, 7\\]</div>\n<p>Vi kan se, at de forskellige observationer er: <span class=\"math notranslate nohighlight\">\\(02, 4, 7, 10, 12\\)</span>. Vi kan nu opstille en hyppighedstabel, der viser hyppigheden <span class=\"math notranslate nohighlight\">\\(h_i\\)</span> af hver observation og frekvensen <span class=\"math notranslate nohighlight\">\\(f_i\\)</span>.</p>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Observation <span class=\"math notranslate nohighlight\">\\((x_i)\\)</span></p></th>\n<th class=\"head\"><p>Hyppighed <span class=\"math notranslate nohighlight\">\\((h_i)\\)</span></p></th>\n<th class=\"head\"><p>Frekvens <span class=\"math notranslate nohighlight\">\\((f_i)\\)</span></p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(02\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{2}{20} = 0{,}1\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(3\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{3}{20} = 0{,}15\\)</span></p></td>\n</tr>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(7\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(8\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{8}{20} = 0{,}4\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(10\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{4}{20} = 0{,}2\\)</span></p></td>\n</tr>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(12\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(3\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{3}{20} = 0{,}15\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><strong>I alt</strong></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(20\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(1\\)</span></p></td>\n</tr>\n</tbody>\n</table>\n</section>\n</div>", "a[href=\"#population-og-stikprove\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1.2. </span>Population og stikpr\u00f8ve<a class=\"headerlink\" href=\"#population-og-stikprove\" title=\"Permalink til denne overskrift\">#</a></h2><p>Forestil dig nu igen, at du \u00f8nsker at sige noget om den gennemsnitlige h\u00f8jde for elever p\u00e5 din skole. I stedet for at m\u00e5le h\u00f8jden p\u00e5 alle eleverne p\u00e5 din skole, s\u00e5 kunne man n\u00f8jes med at m\u00e5le eleverne for en klasse p\u00e5 hver \u00e5rgang. Vi skelner her mellem <em>populationen</em> og en <em>stikpr\u00f8ve</em>. Du er interesseret i at sige noget generelt om alle eleverne p\u00e5 din skole, der er populationen, men du udtager kun en klasse fra hver \u00e5rgang, der agerer din stikpr\u00f8ve.</p>", "a[href=\"#grundlaeggende-begreber\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1. </span>Grundl\u00e6ggende begreber<a class=\"headerlink\" href=\"#grundlaeggende-begreber\" title=\"Permalink til denne overskrift\">#</a></h1><p>N\u00e5r du arbejder med statistik, s\u00e5 er der en masse begreber, du skal have styr p\u00e5. De er vigtige for at kunne formidle, hvad det er for noget statistik, som man laver og arbejder med.</p>", "a[href=\"#equation-eq-kumulfrekvens2\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kumulfrekvens2\">\n\\[    F_i = f_1 + f_2 + \\cdots + f_{i-2} + f_{i-1} + f_i = \\sum_{k=1}^{i} f_k \\]</div>", "a[href=\"#equation-eq-kumulhyppighed2\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kumulhyppighed2\">\n\\[    H_i = h_1 + h_2 + \\cdots + h_{i-1} + h_i = \\sum_{k=1}^i h_k \\]</div>", "a[href=\"#karakterereksempel2\"]": "<div class=\"proof eksempel admonition\" id=\"karakterereksempel2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 12.2 </span> (Karakterer - fortsat)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi forts\u00e6tter med datas\u00e6ttet fra <a class=\"reference internal\" href=\"#karakterereksempel\">Eksempel 12.1</a> og udvider vores tabel med den kumuleret frekvens. Den kumuleret frekvens af vores f\u00f8rste observation er blot lig frekvensen, s\u00e5 <span class=\"math notranslate nohighlight\">\\(F_1 = 0{,}1\\)</span>. Nu kan vi bruge vores formel.</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n    F_2 &amp;= F_1 + f_2 = 0{,}1 + 0{,}15 = 0{,}25 \\\\\n    F_3 &amp;= F_2 + f_3 = 0{,}25 + 0{,}4 = 0{,}65 \\\\\n    F_4 &amp;= F_3 + f_4 = 0{,}65 + 0{,}2 = 0{,}85 \\\\\n    F_5 &amp;= F_4 + f_5 = 0{,}85 + 0{,}15 = 1 \n\\end{align*}\n\\end{split}\\]</div>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Observation <span class=\"math notranslate nohighlight\">\\((x_i)\\)</span></p></th>\n<th class=\"head\"><p>Hyppighed <span class=\"math notranslate nohighlight\">\\((h_i)\\)</span></p></th>\n<th class=\"head\"><p>Frekvens <span class=\"math notranslate nohighlight\">\\((f_i)\\)</span></p></th>\n<th class=\"head\"><p>Kumuleret frekvens <span class=\"math notranslate nohighlight\">\\((F_i)\\)</span></p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(02\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{2}{20} = 0{,}1\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}1\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{4}{20} = 0{,}2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}1 + 0{,}15 = 0{,}25\\)</span></p></td>\n</tr>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(7\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(7\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{7}{20} = 0{,}35\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}25 + 0{,}4 = 0{,}65\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><span class=\"math notranslate nohighlight\">\\(10\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(4\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{4}{20} = 0{,}2\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}65 + 0{,}2 = 0{,}85\\)</span></p></td>\n</tr>\n<tr class=\"row-even\"><td><p><span class=\"math notranslate nohighlight\">\\(12\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(3\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(\\frac{3}{20} = 0{,}15\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(0{,}85 + 0{,}15 = 1\\)</span></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><strong>I alt</strong></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(20\\)</span></p></td>\n<td><p><span class=\"math notranslate nohighlight\">\\(1\\)</span></p></td>\n<td><p></p></td>\n</tr>\n</tbody>\n</table>\n</section>\n</div>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1.5. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#hyppighed-og-frekvens\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1.3. </span>Hyppighed og frekvens<a class=\"headerlink\" href=\"#hyppighed-og-frekvens\" title=\"Permalink til denne overskrift\">#</a></h2><p>To begreber, du sikkert ogs\u00e5 har st\u00f8dt p\u00e5 i folkeskolen, er hyppighed og frekvens. Datas\u00e6ttet for vores stikpr\u00f8ve indeholder en masse observationer, og der er det af stor betydning for de forskellige statistiske deskriptorer, hvad hyppigheden og frekvensen for en observation er.</p><p>Forestil dig, at du har indsamlet observationerne</p>", "a[href=\"#data-og-observationer\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12.1.1. </span>Data og observationer<a class=\"headerlink\" href=\"#data-og-observationer\" title=\"Permalink til denne overskrift\">#</a></h2><p>For at kunne udf\u00f8re deskriptiv statistik, s\u00e5 bliver vi n\u00f8dt til at have en samling af information at lave det p\u00e5. Samling af information kaldes ogs\u00e5 <em>data</em>, der b\u00e5de kan best\u00e5 af tal, ord eller billeder. For at f\u00e5 data laver man ofte en dataindsamling. Det kan ske gennem unders\u00f8gelser, hvor man forinden har defineret den data, som man er interesseret i. Derfor bliver data ofte en masse m\u00e5linger af bestemte variabler. M\u00e5lingerne, som vi f\u00e5r ind kalder vi ogs\u00e5 for <em>datapunkter</em> eller <em>observationer</em>. Det er observationerne, som vi bruger til at sige noget om det data, der er blevet indsamlet.</p>", "a[href=\"#equation-eq-kumulfrekvens\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kumulfrekvens\">\n\\[    F_i = F_{i-1} + f_i \\]</div>", "a[href=\"#equation-eq-kumulfrekvens3\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kumulfrekvens3\">\n\\[    F_i = \\frac{1}{n}\\sum_{k=1}^{i} h_k = \\frac{H_i}{n},\\]</div>", "a[href=\"#equation-eq-frekvens\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-frekvens\">\n\\[    f_i = \\frac{h_i}{n} \\]</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
